import React from 'react';
import { useNavigate } from 'react-router-dom';
import Layout from "../../components/ui/Layout";
import TinderLogo from '../../../src/images/tinder.png';

import './Home.css';

import { Button, ButtonGroup } from 'react-bootstrap';

const Home = ({ children }) => {
    // defino el objeto navigate
    const navigate = useNavigate();

    const handleClick = () => {
        // redirige al login cuando el boton se clickea
        navigate('/login');
    }

    return (
        <>
            <div className="container-fluid">
                <div className="home-title">   
                <div></div>         
                    <img src={TinderLogo} alt="Logo" className="tinder-logo" />
                    <h1>RESTAURANT TINDER</h1>
                    <p>Press the button to login</p>
                    <ButtonGroup>
                        <Button onClick={handleClick}>Login</Button>
                    </ButtonGroup>
            </div>

            {children}
            </div>
        </>
    );
}
export default Home;
